type IType = "backgroud"|"icons"|"magic"|"";

export default function GetImage(type:IType,name:string , ending:string ="png"){
    let image :any;
    let folder = "";
    switch(type){
        case "backgroud":
            folder = ""; 
            break;
        case "backgroud":
            folder = ""; 
            break;
        case "backgroud":
            folder = ""; 
            break;
    }


    try{
        image = require(`../Images/${folder}/${name}.${ending}`);
    }
    catch{
        console.log("image not found")
    }
    return image;
}
